\n\r\n<h2>We are Leaders</h2>\r\n\r\n<p>We lead the market with our outstanding products like Online Exam Portal, E-Commerce Applications, Network Marketing Software (MLM), Direct Selling Softwares etc. We always provide customized application development for our clients which polish our product everytime and leads it to a market leader product of IWT.</p>\r\n\r\n<h3>Our Success Edge</h3>\r\n\r\n<p>Business analysis with customer approach gives us an exteme success edge. Our rich business domain experience capable IWT to speak the same language as our clients and understand their customized software requirements easily. Our knowledge and business analysis stretches from application design, development and integration to operating key processes.</p>\r\n','<p>We always feel our customers as our partners as we always promote referral business in our comapany. When our customer recommend us, It&#39;s will be like Reward of our services.</p>\r\n',0,'',1,'Pu','2015-01-09 19:59:17',9,10,'2015-01-09 15:40:44','2015-01-09 19:59:30'),(34,0,165,'Free shipping','free-shipping','Widget','','<p><em>Express delivery withing 3 days</em></p>',0,'',1,'Pu','2015-01-09 19:59:44',11,12,'2015-01-09 15:43:45','2015-01-09 20:00:14'),(35,0,165,'Daily Gifts','daily-gifts','Widget','<p><br></p>','<p><em>3 Gifts daily for lucky customeras</em></p>',0,'ginger123@@23',1,'Pu','2015-01-09 19:59:44',13,14,'2015-02-04 05:56:24','2015-01-09 20:00:31'),(36,0,165,'477 505 8877','477-505-8877','Widget','','<p><em>24/7 customer care available</em></p>',0,'',1,'Pu','2015-01-09 20:01:02',15,16,'2015-01-09 20:01:09','2015-01-09 20:01:09'),(37,0,165,'About Us','about-us','Page','<p style=\"margin-bottom: 20px; color: rgb(62, 77, 92); font-family: \'Open Sans\', Arial, sans-serif; line-height: normal;\">Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamco