insert  into `newsletters`(`id`,`newsletter_category_id`,`title`,`subject`,`slug`,`content`,`placeholders`,`description`,`status`,`modified`,`created`) values (3,11,'Diwali Special','Happy Diwali','diwali-special','<div class=\"movableContent\"><table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"container\" style=\"width:600px\">	<tbody>		<tr>			<td colspan=\"3\">			<div class=\"contentEditableContainer contentTextEditable\">			<div class=\"contentEditable\">			<h2 style=\"text-align:center\">[SUBJECT]</h2>			</div>			</div>			</td>		</tr>		<tr>			<td>&nbsp;</td>			<td>			<div class=\"contentEditableContainer contentTextEditable\">			<div class=\"contentEditable\">			<p>Hi [USER],<br />			<br />			Diwali is one of the happiest holidays in India, with significant preparations. People clean their homes and decorate them for the festivities. Diwali is one of the biggest shopping seasons in India; people buy new clothes for themselves and their families, as well as gifts, appliances, kitchen utensils, even expensive items such as cars and gold jewelry.<sup><a href=\"http://en.wikipedia.org/wiki/Diwali#cite_note-30\">[30]</a></sup> People also buy gifts for family members and friends which typically include sweets, dry fruits, and seasonal specialties depending on regional harvest and customs.</p>			</div>			<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"height:157px; width:374px\">				<tbody>					<tr>						<td><img alt=\"\" src=\"data:image/jpeg;base64,\" style=\"height:144px; width:509px\" /></td>					</tr>				</tbody>			</table>			<p>&nbsp;</p>			</div>			</td>			<td>&nbsp;</td>		</tr>	</tbody></table></div>','[SUBJECT]: This placeholder will use for Subject of Newsletter.\r\n[USER]:This placeholder will use for user`s Name.\r\n[Email]:This placeholder will use for user`s Email.\r\n[FORWARD]:This placeholder will use as link of forward to friend.\r\n[UNSUBSCRIBE]:This placeholder will use as link of unsubscribe this newsletter.','Diwali is one of the happiest holidays in India, with significant preparations. People clean their homes and decorate them for the festivities. Diwali is one of the biggest shopping seasons in India. ',1,'2014-12-26 05:07:08','2014-12-25 11:03:24'),(5,12,'Holiday Special','Happy Holiday','holiday-special','<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"container\" style=\"width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<h2 style=\"text-align:center\">[SUBJECT]</h2>\r\n			</div>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<p>Hi [USER],<br />\r\n			<br />\r\n			Depending on how you feel you can spend the day at an absolutely gorgeous and wide beach. Loungers, umbrellas, goggles, fins and snorkels are at the beach available. (you can run for hours without meeting anybody). If you prefer to know the island and its inhabitants, Frank and Gabi are always planning different island tours. (For examle visiting Mount Alvernia, the Monastery &ldquo;The Hermitage&rdquo;).<br />\r\n			The resort is only 1 year old, there are 5 super beautifully designed bungalows, top decorated and very clean. From each of the 5 bungalows you have a direct view (from the bed) to the beach and the amazing turquoise water. Enjoye Your holiday.</p>\r\n			</div>\r\n\r\n			<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n				<tbody>\r\n					<tr>\r\n						<td><img alt=\"\" src=\"http://www.imgion.com/images/01/Winter-Season-With-Happy-Holiday-.jpg\" style=\"height:108px; width:164px\" /></td>\r\n						<td><img alt=\"\" src=\"http://www.imgion.com/images/01/For-You-Happy-Holiday-.jpg\" style=\"height:108px; width:164px\" /></td>\r\n						<td><img alt=\"\" src=\"http://www.moneymagpie.com/wp-content/uploads/2009/05/holiday-destinations-indiaextras.jpg\" style=\"height:108px; width:164px\" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</div>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','[SUBJECT]: This placeholder will use for Subject of Newsletter.\r\n[USER]:This placeholder will use for user`s Name.\r\n[Email]:This placeholder will use for user`s Email.\r\n[FORWARD]:This placeholder will use as link of forward to friend.\r\n[UNSUBSCRIBE]:This placeholder will use as link of unsubscribe this newsletter.','Holiday Newsletter Description',1,'2014-12-25 14:14:57','2014-12-25 11:10:50'),(7,13,'Annual Day Function','Happy Annual Day','annual-day-function','<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"container\" style=\"width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<h2 style=\"text-align:center\">[SUBJECT]</h2>\r\n			</div>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<p>Hi [USER],<br />\r\n			<br />\r\n			For almost all the educational institutions starting from school, college and university, the annual day function has become a sort of compulsory celebration as during this annual day.</p>\r\n			</div>\r\n\r\n			<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n				<tbody>\r\n					<tr>\r\n						<td><img alt=\"\" src=\"http://static.yoovite.com/images/events/thumb/Annual_function5_thumb.jpg\" style=\"height:108px; width:164px\" /></td>\r\n						<td><img alt=\"\" src=\"http://www.dpsgrnoida.com/DPSGrNoida/UserSpace/UserName/dpsnadmin/DynamicFolder/HomePage_New/events/image/annual-j2.jpg\" style=\"height:110px; width:163px\" /></td>\r\n						<td><img alt=\"\" src=\"http://www.desievite.com/Documents/9_AnnnualFunction092.jpg\" style=\"height:137px; width:164px\" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</div>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','[SUBJECT]: This placeholder will use for Subject of Newsletter.\r\n[USER]:This placeholder will use for user`s Name.\r\n[Email]:This placeholder will use for user`s Email.\r\n[FORWARD]:This placeholder will use as link of forward to friend.\r\n[UNSUBSCRIBE]:This placeholder will use as link of unsubscribe this newsletter.','For almost all the educational institutions starting from school, college and university, the annual day function has become a sort of compulsory celebration as during this annual day.',1,'2014-12-25 14:15:05','2014-12-25 11:13:04'),(8,11,'Christmas Special','Merry Christmas','christmas-special','<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<h2>[SUBJECT]</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<p>Hi [USER],<br />\r\n			&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Christmas is celebrated all over the world, as a religious holiday or as a time of celebration by Christians and non-Christians alike. The traditions are different from country to country, but they nearly always include a feast, giving gifts or cards, and enjoying church or public festivities such as singing Christmas carols and songs. Santa Claus is a tradition in many countries of the world.</p>\r\n\r\n			<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n				<tbody>\r\n					<tr>\r\n						<td><img alt=\"\" src=\"http://14434396.r.lightningbase-cdn.com/wp-content/uploads/Merry-Christmas-from-LearnDash.jpg\" style=\"height:108px; width:164px\" /></td>\r\n						<td><img alt=\"\" src=\"http://i.123g.us/c/edec_c_spirit/card/105539.gif\" style=\"height:108px; width:164px\" /></td>\r\n						<td><img alt=\"\" src=\"http://techbeasts.com/wp-content/uploads/2014/12/Merry-Christmas-Photos-18.jpg\" style=\"height:108px; width:164px\" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n\r\n			<p>Site name : #SITENAME#</p>\r\n\r\n			<p>Site link : #SITELINK#</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','[SUBJECT]: This placeholder will use for Subject of Newsletter.\r\n[USER]:This placeholder will use for user`s Name.\r\n[Email]:This placeholder will use for user`s Email.\r\n[FORWARD]:This placeholder will use as link of forward to friend.\r\n[UNSUBSCRIBE]:This placeholder will use as link of unsubscribe this newsletter.','Christmas is celebrated all over the world, as a religious holiday or as a time of celebration by Christians and non-Christians alike. ',1,'2015-01-05 11:57:46','2014-12-25 12:54:02'),(9,11,'Holi Special','Happy Holi','holi-special','<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"container\" style=\"width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<h2 style=\"text-align:center\">[SUBJECT]</h2>\r\n			</div>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<p>Hi [USER],<br />\r\n			<br />\r\n			Holi is an important festival to Hindus. It is celebrated at the end of the winter season on the last full moon day of the lunar month Phalgun (February/March), (Phalgun Purnima), which usually falls in March, sometimes in late February.</p>\r\n			</div>\r\n\r\n			<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n				<tbody>\r\n					<tr>\r\n						<td><img alt=\"\" src=\"http://www.holifestival.org/gifs/holi-wallpaper1-b.jpg\" style=\"height:108px; width:164px\" /></td>\r\n						<td><img alt=\"\" src=\"http://media1.santabanta.com/full1/Festivals/Holi/holi-67a.jpg\" style=\"height:108px; width:164px\" /></td>\r\n						<td><img alt=\"\" src=\"http://www.media.glamsham.com/download/wallpaper/festivals/holi/holi-wallpaper-12-12x9.jpg\" style=\"height:108px; width:164px\" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</div>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','[SUBJECT]: This placeholder will use for Subject of Newsletter.\r\n[USER]:This placeholder will use for user`s Name.\r\n[Email]:This placeholder will use for user`s Email.\r\n[FORWARD]:This placeholder will use as link of forward to friend.\r\n[UNSUBSCRIBE]:This placeholder will use as link of unsubscribe this newsletter.','Holi is an important festival to Hindus. It is celebrated at the end of the winter season on the last full moon day of the lunar month Phalgun (February/March), (Phalgun Purnima), which usually falls in March, sometimes in late February.',1,'2014-12-25 14:22:21','2014-12-25 14:22:21'),(10,12,'Sunday Special','Enjoy Sweet Sunday ','sunday-special','<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<h2>[SUBJECT]</h2>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<p>Hi [USER],<br />\r\n			<br />\r\n			Sunday, being the day of the Sun, as the name of the first day of the week, is derived from Egyptian astrology, where the seven planets, known in English as Saturn, Jupiter, Mars, the Sun, Venus, Mercury and the Moon, each had an hour of the day assigned to them, and the planet which was regent during the first hour of any day of the week gave its name to that day. During the 1st and 2nd century, the week of seven days was introduced into Rome from Egypt, and the Roman names of the planets were given to each successive day.</p>\r\n\r\n			<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"height:119px; width:485px\">\r\n				<tbody>\r\n					<tr>\r\n						<td>&nbsp;</td>\r\n						<td><img alt=\"\" src=\"http://i.myniceprofile.com/1388/138879.gif\" style=\"height:106px; width:235px\" /><img alt=\"\" src=\"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQmANVrgs1mQ2dMwNNN4u8FIb9uF7ieg-3NM2OOte_OtwhbmKRLAA\" style=\"height:106px; width:235px\" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','[SUBJECT]: This placeholder will use for Subject of Newsletter.\r\n[USER]:This placeholder will use for user`s Name.\r\n[Email]:This placeholder will use for user`s Email.\r\n[FORWARD]:This placeholder will use as link of forward to friend.\r\n[UNSUBSCRIBE]:This placeholder will use as link of unsubscribe this newsletter.','Sunday is a day that have very restful for everyone. Enjoy Your sweet Sunday.',1,'2015-01-09 13:10:05','2014-12-25 14:32:11'),(11,12,'New Year','Happy New Year','new-year','<table align=\"center\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"container\" style=\"width:600px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\">\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<h2 style=\"text-align:center\">[SUBJECT]</h2>\r\n			</div>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<div class=\"contentEditableContainer contentTextEditable\">\r\n			<div class=\"contentEditable\">\r\n			<p>Hi [USER],<br />\r\n			<br />\r\n			<em>NEW YEAR</em> - That brings something new in life. A resolution to bring hopes and a spirit to overcome all the darkness of past year. A determination to start all things with a new beginning which we failed to complete in the past year, some new promises to make life more beautiful, peaceful and meaningful and of completion of all desires that are deserve to be, to get ultimate pleasure. Wish happy new year 2014 to your friends, relatives and loved ones to make their new year full of fun and prosperity with the vast collection of new year holiday greetings and glitters.</p>\r\n\r\n			<p style=\"text-align: justify; margin-left: 200px;\"><strong>Wish You Happy New Year</strong></p>\r\n			</div>\r\n\r\n			<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n				<tbody>\r\n					<tr>\r\n						<td><img alt=\"\" src=\"https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcQCMpyxih1BuZvuKRWVmCLGGeFlxIXgvgPDW1eto62HyK4h-RQz\" style=\"height:168px; width:446px\" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>&nbsp;</p>\r\n			</div>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','[SUBJECT]: This placeholder will use for Subject of Newsletter.\r\n[USER]:This placeholder will use for user`s Name.\r\n[Email]:This placeholder will use for user`s Email.\r\n[FORWARD]:This placeholder will use as link of forward to friend.\r\n[UNSUBSCRIBE]:This placeholder will use as link of unsubscribe this newsletter.','New Year Comes with great enjoment for all . Happy New Year.',1,'2014-12-25 14:43:14','2014-12-25 14:43:14');

