u reply to this email with the information listed =\r\nat http://goo.gl/t2j8tO.=20\r\n\r\nIn the meantime, you can visit our Quick Fixes help center at http://goo.gl=\r\n/IbG1JP to find simple answers to our most commonly asked questions.=20\r\n\r\nThanks for choosing Google Apps,\r\n\r\nGoogle for Work Support\r\n_____________________________________________________=20\r\nCase: #07764891=20\r\nSubject: Google Signing is preventing me to login through imap interface=20\r\n\r\nPlease find our developer issues in =20\r\nrelation to the email address namely mail@lionsbusinessbrokers.com which we=\r\n =20\r\nhave given him access to test the Google mail connection with our CRM. Here=\r\n =20\r\nis the message from our developer for your review and action:\r\nISSUE 1\r\n\r\nGoogle Signing is preventing me to login through imap interface/protocol\r\n\r\nI have attached  my php script for reference . I am able to connect and get=\r\n =20\r\nemail through some\r\n\r\nof my other gmail account but this account (mail@lionsbusinessbrokers.com) =\r\n=20\r\nis giving me error too many login failures\r\n\r\n\r\nISSUE 2\r\n  I have one more request from gmail\r\nI more interested to connect to gmail using their gmail api\r\nBut I do not have right code to get connected to them, I have tried that =\r\n=20\r\nusing google php client library but\r\n\r\nit does not have  example for gmail , so I tried experimenting myself but I=\r\n =20\r\nwas not able to do so\r\n\r\nPlease help me with gmail api also\r\n',NULL,NULL,842),(843,'Wed, 25 Nov 2015 12:16:45 +0000 (GMT)','84',NULL,'Google for Work Support <esupport@google.com>','[#07764891] Google Signing is preventing me to login through imap interface    [ ref:_00D00VNwG._50060uAjok,00D6GEAW.5006okAAC:ref ]','Hello Darius,\r\n\r\nThank you for your message. I understand you are having an issue with loggi=\r\nng in through IMAP for your domain lionsbusinessbrokers.com.\r\n\r\nWith regards to accessing your CRM through IMAP, can you enable less secure=\r\n apps for the account as follows https://support.google.com/accounts/answer=\r\n/6010255?hl=3Den.\r\nIf the issue persists can you provide a screenshot of any error messages be=\r\ning received?\r\nFor more information on taking screenshots please see the following https:/=\r\n/support.google.com/adsense/answer/38066?hl=3Den.\r\n\r\nWith regards to your API query you can find more information here https://d=\r\nevelopers.google.com/gmail/api/v1/reference/users/messages/send.\r\nOur APIs are HTTPS based and can be accessed from any REST client including=\r\n a PHP library with HTTP transport options. We don\'t support any specific i=\r\nmplementation of this however in the event you require more assistance plea=\r\nse let me know and I\'ll assign a case to our API team for review.=20\r\n\r\nI hope you find this information helpful. If you have any more questions or=\r\n queries I=E2=80=99ll be glad to help.\r\n\r\nSincerely,=20\r\n\r\nCian\r\nGoogle for Work Support\r\n\r\n-------------------------\r\n\r\nCase: #07764891\r\nSubject: Google Signing is preventing me to login through imap interface\r\n\r\nPlease find our developer issues in =20\r\nrelation to the email address namely mail@lionsbusinessbrokers.com which we=\r\n =20\r\nhave given him access to test the Google mail connection with our CRM. Here=\r\n =20\r\nis the message from our developer for your review and action:\r\nISSUE 1\r\n\r\nGoogle Signing is preventing me to login through imap interface/protocol\r\n\r\nI have attached  my php script for reference . I am able to connect and get=\r\n =20\r\nemail through some\r\n\r\nof my other gmail account but this account (mail@lionsbusinessbrokers.com) =\r\n=20\r\nis giving me error too many login failures\r\n\r\n\r\nISSUE 2\r\n  I have one more request from gmail\r\nI more interested to connect to gmail using their gmail api\r\nBut I do not have right code to get connected to them, I have tried that =\r\n=20\r\nusing google php client library but\r\n\r\nit does not have  example for gmail , so I tried experimenting myself but I=\r\n =20\r\nwas not able to do so\r\n\r\nPlease help me with gmail api also\r\n\r\n+++\r\nref:_00D00VNwG._50060uAjok,00D6GEAW.5006okAAC:ref\r\n',NULL,NULL,843),(844,'Thu, 26 Nov 2015 11:34:36 +0530','84',NULL,'Darius Naghavi <mail@lionsbusinessbrokers.com>','test','--001a113edbbc803a3f05256b59db\r\nContent-Type: text/plain; charset=UTF-8\r\n\r\ntst\r\n\r\n--001a113edbbc803a3f05256b59db\r\nContent-Type: text/html; charset=UTF-8\r\n\r\n<div dir=\"ltr\">tst</div>\r\n\r\n--001a113edbbc803a3f05256b59db--',NULL,NULL,844),(845,'Sun, 18 Oct 2015 22:04:36 -0700','84',NULL,'\"lionsbusinessbrokers.com\" <enquiry@lionsbusinessbrokers.com>','You have received an enquiry from your business listing on lionsbusinessbrokers.com','<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\">\r\n<html>\r\n<body> \r\n    <h2	style=\"background-color: #278EA9; color: white; width: 100%; padding-left: 10px; padding-top: 10px; height: 34px;\">\r\n	LionsBusinessBrokers<span style=\"color: white; font-size: 80%;\">.com</span>\r\n</h2>\r\n\r\nDear LionsGroup,\r\n<br>\r\n<br>\r\n<p>You have received an enquiry from your business listing on\r\n	LionsBusinessBrokers.com</p>\r\n<br>\r\n<table style=\"width: 100%;\">\r\n	<tr>\r\n		<td colspan=\"2\" style=\"font-weight: bold; background: #EBEBEB;\">Advert\r\n			Details:</td>\r\n	</tr>\r\n	<tr>\r\n		<td valign=\"top\" style=\"width: 25%\">Advert ID:</td>\r\n		<td style=\"width: 75%;\">\r\n			11196	\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td valign=\"top\" style=\"width: 25%\">Advert Headline:</td>\r\n		\r\n		<td style=\"width: 75%;\">\r\n				<a href=\"http://lionsbusinessbrokers.com/businessdetails/profile/13808515/2\">TRANSPORT COMPANY				</a>\r\n		</td>\r\n	</tr>\r\n	<tr>\r\n		<td valign=\"top\" style=\"width: 25%\">Price:</td>\r\n		<td style=\"width: 75%;\">\r\n		$970		</td>\r\n	</tr>\r\n	<tr>\r\n		<td colspan=\"2\"><br></td>\r\n	</tr>\r\n	<tr>\r\n		<td colspa